description:
It is your second meeting Dela, the main heroine of a new romance-themed Hidden Object adventure puzzle. In Tiger Eye: The Sacrifice, you will have just more interesting tasks and twists that will easily throw you into a breathtaking web of drama. Will you manage to help Dela escape from Beijing with her lover Hari and save her best friend? Will you be able to fool the mafia, chasing poor girl? All these challenges await you in the new free download game - Tiger Eye: The Sacrifice. Be ready to enjoy this title as soon as it comes here! 
